import React, {Component} from 'react';

import './menu.css';

class Menu extends Component {
    render(){
        return(
            <div id='menu'>
                <div id='mPages'>
                    <img src={require('../../assets/imgs/logo-mapadareciclagem.png')} alt='logo'/>
                    <strong>Station</strong>
                    <strong>Product</strong>
                    <strong>Cadastrar</strong>
                </div>
                <div id='mEntrar'>
                    <strong>Entrar</strong>
                </div>
            </div>
        )
    }
}
export default Menu;
